import React from "react";
import {useNavigate} from "react-router-dom";
function Main() {
    const navigate = useNavigate();

    return (
        <div>
            Culture Shock
            <button onClick={() => navigate("/Navbar")}>
                Go to Navbar
            </button>
        </div>
    )
}

export default Main;
